qiao 2024 event\"/\u003e\u003c/Group\u003e\u003cText\u003e\u003c![CDATA[### Country with Most people in a final  \nMale Lead\t\t- Japan - WC Briancon 2023 - 7 Men  \n                - Japan - WC Jakarta 2022 - 4 Men  \n                - Japan - WC Villars 2022 - 4 Men  \n\t\t\t\t- Japan - WC Xiamen 2019 - 4 Men  \n\nFemale Lead \t- Austria - WChamp 2011 - 5 Women  \n\t\t\t\t- Slovenia - WC Villars 2021 - 4 Women  \n\t\t\t\t- Japan - WC Inzai 2019 - 4 Women  \n\t\t\t\t- Slovenia - WC Xiamen 2018 - 4 Women  \n\t\t\t\t- Slovenia - WC Briancon 2018 - 4 Women   \n\t\t\t\t- Austria - WC Barcelona 2011 - 4 Women  \n\t\t\t\t- Austria - WC Valence 2011 4 Women  \n\t\t\t\t- Austria - WC Puurs 2011 - 4 Women  \n\nMens Boulder \t- Japan - WC Seoul 2022 - 5 Men  \n\t\t\t\t- Japan - WC Meiringen 2021 - 4 Men  \n\t\t\t\t- Japan - WC Meiringen 2019 - 4 Men  \n\t\t\t\t- Japan - WC Wuijang 2019 - 4 Men  \n\t\t\t\t- Japan - WC Vail 2018 - 4 Men  \n\t\t\t\t- Japan - WC Munich 2017 - 4 Men  \n\t\t\t\t- France - WC Laval 2014 - 4 Men  \n\t\t\t\t- Japan - WC Vail 2017 - 4 Men  \n\nFemale Boulder \t- France - WC La Reunion 2007 - 4 Women  \n\t\t\t\t- USA - WC Vail 2008 - 3 Women  \n\t\t\t\t- Slovenia - WC Munich 2019 - 3 Women  \n\t\t\t\t- Japan - WC Vail 2019 - 3 Women]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Country World Cup Series Medal Table\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Cup Series Medal Table for Boulder\" src=\"ref://d53278319e\" caption=\"results including Keqiao 2024 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Cup Series Medal Table for Lead\" src=\"ref://2167bcfd9f\" caption=\"results including Wujiang 2023 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Cup Series Medal Table for Speed\" src=\"ref://d5b3fa6813\" caption=\"results including Wujiang 2023 event\"/\u003e\u003cTable type=\"application/vnd.datapane.table+html\" label=\"World Cup Series Medal Table all Disciplines\" src=\"ref://c7fd1307e0\" caption=\"results including Wujiang 2023 event\"/\u003e\u003cGroup label=\"World Cup Series Boulder podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://38c51fc462\" caption=\"Boulder\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Cup Series Lead podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://fb7c03b4ab\" caption=\"Lead\"/\u003e\u003c/Group\u003e\u003cGroup label=\"World Cup Series Speed podium list (male and female)\" columns=\"1\" valign=\"top\"\u003e\u003cTable type=\"application/vnd.datapane.table+html\" src=\"ref://f847f9695a\" caption=\"Speed\"/\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/Group\u003e\u003cGroup label=\"Special Analysis World Cups\" columns=\"1\" valign=\"top\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Male Speed Qualifying times by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://bba717bf57\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Female Speed Qualifying times by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://0734235f6e\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://ddcdc1712e\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://e5ee6c68a4\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Lead Tops in Finals \u0026amp; Semi-Finals by Year\" responsive=\"true\" scale=\"1.0\" src=\"ref://8ebd419c7c\"/\u003e\u003cText label=\"Analysis\"\u003e\u003c![CDATA[### This explains the Speed box plots  \nThe horizontal lines bottom and top are the min and max values  \nThe line across the waist of the box is the median value  \nThe bottom and top of the box are the 1st and 3rd quartile values  \nThe dots at the top are statistical outliers  \n\n  Hover on a box and it will show all the values  \n\n### Speed Analysis  \nparticuluarly in the Mens results you can see the height of the box has shrunk meaning the times of the majority and getting closer  \n2021 only had 2 events so doesn\u0027t have as much variation as normal years with more events.  \nThe times before 2012 were so slow you couldn\u0027t see the detail in the later years  \nThis is qualifying times only, the finals times are harder to collate as the format on the IFSC website has changed over the years  \n\n### Lead Analysis  \nThis show that generally there are more tops in female lead comps than there are in mens, this indicates the women are not being challenged as much as the men.  \nIn Finals in 12 of the last 16 years there have been more female tops, only 2 years where there were more tops, and 2 years where they were the same.]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"388d6ba117": {"src": "data:application/vnd.datapane.table+html;base64,PHN0eWxlIHR5cGU9InRleHQvY3NzIj4KI1RfZDJhZTdfICB7CiAgYm9yZGVyOiAycHggc29saWQgYmxhY2s7Cn0KI1RfZDJhZTdfcm93MF9jb2wxIHsKICB3aWR0aDogMTBlbTsKICBoZWlnaHQ6IDgwJTsKICBiYWNrZ3JvdW5kOiBsaW5lYXItZ3JhZGllbnQoOTBkZWcsbGlnaHRibHVlIDEwMC4wJSwgdHJhbnNwYXJlbnQgMTAwLjAlKTsKfQojVF9kMmFlN19yb3cxX2NvbDEgewogIHdpZHRoOiAxMGVtOwogIGhlaWdodDogODAlOwogIGJhY2tncm91bmQ6IGxpbmVhci1ncmFkaWVudCg5MGRlZyxsaWdodGJsdWUgNzguOSUsIHRyYW5zcGFyZW50IDc4LjklKTsKfQojVF9kMmFlN19yb3cyX2NvbDEsICNUX2QyYWU3X3JvdzNfY29sMSB7CiAgd2lkdGg6IDEwZW07CiAgaGVpZ2h0OiA4MCU7CiAgYmFja2dyb3VuZDogbGluZWFyLWdyYWRpZW50KDkwZGVnLGxpZ2h0Ymx1ZSAzNi44JSwgdHJhbnNwYXJlbnQgMzYuOCUpOwp9CiNUX2QyYWU3X3JvdzRfY29sMSB7CiAgd2lkdGg6IDEwZW07CiAgaGVpZ2h0OiA4MCU7CiAgYmFja2dyb3VuZDogbGluZWFyLWdyYWRpZW50KDkwZGVnLGxp
